        "Introduction": "<div><strong>保险项目和保险限额:</strong><table class='other_product_tb'><tbody><tr><td rowspan='3'><strong>旅程阻碍保障</strong></td><td>旅程延误</td><td>600元</td></tr><tr><td>行李延误</td><td>1,000元</td></tr><tr><td>旅行变更</td><td>5,000元</td></tr><tr><td rowspan='4'><strong>个人财物保障</strong></td><td>个人钱财损失</td><td>2,000元</td></tr><tr><td>个人行李及随身物品</td><td>2,000元</td></tr><tr><td>银行卡盗刷</td><td>5,000元</td></tr><tr><td>宠物犬交通意外死亡保障</td><td>1.000元</td></tr><tr><td rowspan='10'><strong>个人意外伤害和医疗保障</strong></td><td>意外身故和伤残</td><td>500,000元</td></tr><tr><td> 交通工具意外身故、残疾</td><td>400,000元</td></tr><tr><td>突发急性病身故和残疾</td><td>80,000元</td></tr><tr><td>高风险运动意外伤害</td><td>包含</td></tr><tr><td>医药补偿</td><td>100,000元</td></tr><tr><td>住院津贴</td><td>150元/天</td></tr><tr><td>旅游大巴意外身故</td><td>80,000元</td></tr><tr><td>特定事故保障身故或残疾</td><td>5,000元</td></tr><tr><td>恐怖袭击</td><td>50,000元</td></tr><tr><td>个人酒店住宿意外身故、残疾</td><td>50,000元</td></tr><tr><td rowspan='7'><strong>紧急救援</strong></td><td>医疗运送和送返</td><td>200,000元</td></tr><tr><td>丧葬保险金</td><td>6,000元</td></tr><tr><td>慰问探访费用补偿</td><td>6,000元</td></tr><tr><td>亲属前往处理后事</td><td>6,000元</td></tr><tr><td>救护车费用报销</td><td>500元</td></tr><tr><td>意外和急性病医疗费用垫付</td><td>包含</td></tr><tr><td>全国救援服务</td><td>包含</td></tr><tr><td><strong>个人责任</strong></td><td>个人责任</td><td>100,000元</td></tr></tbody></table></div><div><strong>详细信息请见 <a href='http://vacations.ctrip.com/insurance/product/147' target='_blank'>“平安携程境内长线保险 尊贵型”</a>，请仔细阅读<a href='http://pages.ctrip.com/tour/pdf1/120214a.pdf' target='_blank'>“保险条款”</a>和其中的免除责任。<br/>特殊说明:</strong><p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">1、71至80周岁的被保险人，其\"意外身故、残疾保障\"和\"公共交通工具飞机/火车/轮船/汽车意外伤害\"、\"旅游大巴意外伤害\"的保险金额为保单所载金额的一半，81至90周岁的被保险人，其\"意外身故、残疾保障\"和\"公共交通工具飞机/火车/轮船/汽车意外伤害\"、\"旅游大巴意外伤害\"的保险金额为保单所载金额的四分之一。每人每次限购1份。90周岁以上不承保。</p>\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">2、按中国保监会规定，除航空意外死亡及重大自然灾害意外死亡外，任何不满10周岁的被保险人，其死亡保险金额不得超过人民币20万元；已满10周岁但未满18周岁的被保险人，其死亡保险金额不得超过50万元。</p>\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">3、投保人为被保险人投保须征得被保险人同意；被保险人为未成年人的须征得其监护人同意。&nbsp;</p>\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">4、旅行变更项下扩展责任：</p>\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">1）扩展因怀孕或骨折导致的旅行取消：指扩展被保险人自在携程成功购买保险时起、至被保险人按预定行程开始旅行时止的期间，被保险人或其配偶发生正常妊娠或者被保险人或其直系亲属骨折导致不适宜旅行的，保险公司按约定赔偿被保险人已经支付且无法追回的旅费，以本附加险项下的保险金额为限，被保险人索赔时应提供区县级以上公立医院出具正常妊娠诊断或骨折证明。说明：正常妊娠不含宫外孕、葡萄胎。</p>\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">2）扩展去程航班延误连续达10小时及以上的旅行取消：指扩展被保险人旅行出发时搭乘的首个班次的航班延误时间连续达10个小时及以上导致被保险人取消旅行的，保险公司对于被保险人已经支付且无法追回的旅费按70%的比例进行赔偿，以本附加险项下的保险金额为限，被保险人索赔时应提供航空公司出具的关于延误原因和延误时间的正式书面证明文件。</p>\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">5、救护车费用报销：被保险人不幸发生意外伤害或突发急性病事故后，需要从事故地点乘坐急救车至医院就诊，请直接拨打4007005996，北京浩然正康将根据实际情况为您安排急救车辆，并承担急救车车费和必要的车上救护费用（包括急救车上用药、治疗、担架费用），限额以保单载明的为限。若未通过救援服务机构呼叫急救车的相关费用不适用于本项服务。请见：<a href=\"http://pages.ctrip.com/tour/pdf5/191.pdf\">救护车费用报销说明</a></p>\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">6、经许可该保险产品可在全国范围内销售，符合本保险产品购买条件的人均可购买。</p>\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">7、由于该保险产品属于短期意外险，在保险起期之前可全额退保，但在起保后（行程开始后）则无法退保。</p>\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">8、中国平安财产保险股份有限公司全国客服、报案电话为95511转5转8。</p>\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">&nbsp;</p>\n<p class=\"MsoNormal\" style=\"margin: 0cm 0cm 0pt; mso-pagination: widow-orphan;\">本页信息不构成保险合同一部分，详细信息请参见保险条款，并以其规定为准。</p></div>",
